const DUMMY_EVENTS = [
  {
    id: "e1",
    title: "Some Event",
  },
  {
    id: "e2",
    title: "Another Event",
  },
];


function EventPage() {
  return (
    <>
    <h1>Event Page</h1>
    <ul>
      {DUMMY_EVENTS.map(event => <li key={event.id}>
        
      </li>)}
    </ul>
    </>
  )
}
